         QScriptValue REcmaCustomEntity::toString
    (QScriptContext *context, QScriptEngine *engine)
    
    {

    RCustomEntity* self = getSelf("toString", context);
    
    QString result;
    
            result = QString("RCustomEntity(0x%1)").arg((unsigned long int)self, 0, 16);
        
    return QScriptValue(result);
    }
     QScriptValue REcmaCustomEntity::destroy(QScriptContext *context, QScriptEngine *engine)
    
    {

        RCustomEntity* self = getSelf("RCustomEntity", context);
        //Q_ASSERT(self!=NULL);
        if (self==NULL) {
            return REcmaHelper::throwError("self is NULL", context);
        }
        
    
        delete self;
        context->thisObject().setData(engine->nullValue());
        context->thisObject().prototype().setData(engine->nullValue());
        context->thisObject().setPrototype(engine->nullValue());
        context->thisObject().setScriptClass(NULL);
        return engine->undefinedValue();
    }
    RCustomEntity* REcmaCustomEntity::getSelf(const QString& fName, QScriptContext* context)
    
        {
            RCustomEntity* self = NULL;

            
                // self could be a normal object (e.g. from an UI file) or
                // an ECMA shell object (made from an ECMA script):
                //self = getSelfShell(fName, context);
                

            //if (self==NULL) {
                self = REcmaHelper::scriptValueTo<RCustomEntity >(context->thisObject())
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("RCustomEntity.%1(): "
                        "This object is not a RCustomEntity").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
        }
        RCustomEntity* REcmaCustomEntity::getSelfShell(const QString& fName, QScriptContext* context)
    
        {
          RCustomEntity* selfBase = getSelf(fName, context);
                RCustomEntity* self = dynamic_cast<RCustomEntity*>(selfBase);
                //return REcmaHelper::scriptValueTo<RCustomEntity >(context->thisObject());
            if(self == NULL){
                REcmaHelper::throwError(QString("RCustomEntity.%1(): "
                    "This object is not a RCustomEntity").arg(fName),
                    context);
            }

            return self;
            


        }
        